  .loader {
    width: 12vh;
    margin: 0 auto;
    border-radius: 10px;
    border: 4px solid transparent;
    position: relative;
    padding: 1px;
    top: 64vh;
    animation: fadein 2s ease-out;
  }

  .loader:before {
    content: '';
    border: 1px solid #666;
    border-radius: 10px;
    position: absolute;
    top: -4px;
    right: -4px;
    bottom: -4px;
    left: -4px;
  }

  .loader .loaderBar {
    position: absolute;
    border-radius: 10px;
    top: 0;
    bottom: 0;
    background: #666;
    animation: loaderBar 6s linear infinite;
  }

  @keyframes fadein {
    from {
      opacity: 0;
    }

    to {
      opacity: 1;
    }
  }

  @keyframes loaderBar {
    0% {
      left: 0%;
      right: 100%;
    }

    50% {
      left: 0%;
      right: 0%;
    }

    100% {
      left: 100%;
      right: 0%;
    }
  }
